class Solution:
    def lengthOfLongestSubstring(self, str):
        if len(str) == 0:
            return 0
        elif len(str) == 1:
            return 1
        substr = ''
        i = 0
        longestSubstring = ''
        while i < len(str):
            if str[i] not in substr:
                substr = substr + str[i]
                if len(substr) >= len(longestSubstring):
                    longestSubstring = substr
                    i += 1
                    # print(longestSubstring)
                else:
                    i += 1
            else:
                str1 = str[0 : i]
                j = str1.rindex(str[i])
                # print(j)
                if i  == j + 1:
                    substr = str[j]
                    # print(substr)
                    i += 1
                else:
                    substr = str[j + 1: i + 1]
                    i += 1
                # substr = str[j + 1 : i + 1]
                # # print(substr)
                # i += 1
                # # i = j + 1
                # # print(substr)

        return longestSubstring

